"

                        Sandisk Extreme Pro CompactFlash 16GB 160MB/s

        Mit der SanDisk Extreme Pro CompactFlash 16 GB 160 MB/s profitieren Sie von einer extrem schnellen Datenübertragungsrate und vielen Funktionen für Spiegelreflexkameras und HD-Camcorder. Die mit den fortschrittlichsten Speichertechnologien von SanDisk ausgestattete Speicherkarte ist die optimale Wahl für Profis. Mit einer Lese- und Schreibgeschwindigkeit von bis zu 160 MB/s sind mit der SanDisk Extreme Pro CompactFlash jetzt noch schnellere Serienaufnahmen im Burst-Modus und Full HD-Videoaufzeichnungen in Kinoqualität möglich.
Besondere Eigenschaften der SanDisk Extreme Pro CompactFlash 16 GB 160 MB/s

Extrem schnelle Lese- und Schreibrate von bis zu 160 MB/s
Große Kapazität von 16 GB
UDMA-Schnittstelle für schnelle Datenübertragung zur Kamera
VPG für erstklassige Full HD-Videoaufnahmen in Kinoqualität

Power Core Controller für Spitzengeschwindigkeiten
Der innovative Speicher-Controller der SanDisk Extreme Pro CompactFlash 16 GB 160 MB/s verteilt Bilddaten schneller und effektiver auf der Speicherkarte, um hohe Datenübertragungsraten zu erzielen. Dank Enhanced Super-Parallel Processing von SanDisk sorgt die SanDisk Extreme Pro CompactFlash außerdem für schnelle, zuverlässige Leistung in allen Aufnahmesituationen.
Bis zu 160 MB/s Schreibgeschwindigkeit
Dank einer Schreibgeschwindigkeit von bis zu 160 MB/s zeichnet die SanDisk Extreme Pro CompactFlash fast sofort auf und reduziert die Wartezeiten zwischen den Aufnahmen. So können Sie bei Serienaufnahmen im Burst-Mode mit Ihrer Spiegelreflexkamera so viele Aufnahmen machen wie nie zuvor.
UDMA-Schnittstelle und VPG für Videoaufnahmen in Kinoqualität
Die fortschrittliche UDMA-Schnittstelle der SanDisk Extreme Pro CompactFlash 16 GB 160 MB/s hält auch mit den hohen Speicheranforderungen hochwertiger Fotos in höchster Auflösung Schritt. Die Speicherkarte bietet außerdem die Video Performance Guarantee (VPG), die eine kontinuierliche minimale Video-Schreibgeschwindigkeit von 20 MB/s erreicht, um die Anforderungen von professionellen Full HD-Videos in Kinoqualität zu erfüllen.
Hohe Speicherkapazität
Die SanDisk Extreme Pro CompactFlash 16 GB bietet viel Platz für Bildformate in hoher Auflösung wie RAW und JPEG. So können Sie mehrere Stunden Videos und Tausende von Fotos auf der Speicherkarte speichern.
Robustes Design
Die SanDisk Extreme Pro CompactFlash Speicherkarte ist für den Einsatz auch unter den widrigsten Bedingungen konzipiert. Der Betriebsbereich der Extreme Pro CompactFlash 16 GB reicht von -25ºC bis 85ºC, sodass Sie unter nahezu allen klimatischen Bedingungen Aufnahmen machen können. Die Speicherkarte wurde rigorosen Belastungs-, Stoß- und Vibrationstestverfahren unterzogen und ist mit einer RTV-Silikonbeschichtung ausgestattet, die bei Stößen und Vibrationen zusätzlichen Schutz bietet.    








