        Product Information



With Sonys VCT-R100 Lightweight Tripod, you add a creative and original twist to digital imaging. Ultra-portable and expandable, the tripod can be adjusted for the perfect height and the perfect shot. Its quick-release, 3-way pan head is easy, convenient, and ideal for steady shooting with your camcorder or digital still camera.

Compatible with Cyber-shot and Handycam® 
Compact, lightweight and convenient for traveling 
Includes lever leg lock function for easy extending and retracting 
Includes Carrying case 
Approx. Size (mm):maximum extension 1000mm, Folded size: 355mm 
Approx. Weight: 660g 










          





        Show more


        $(".show-more-description a").on("click", function () {
            var $this = $(this);
            var $content = $this.parent().prev("div.productdesc");
            var linkText = $this.text().toUpperCase();

            if (linkText === "SHOW MORE") {
                linkText = "Show less";
                $content.switchClass("deschide", "descshow", 1000);
            } else {
                linkText = "Show more";
                $content.switchClass("descshow", "deschide", 1000);
            };

            $this.text(linkText);

        });

        $(".show-more-description a").on("click", function () {
            $(".show-more-description a").toggleClass("downarrow uparrow");


        });

        $(".show-more a").click(function () {
            $('html,body').animate({
                scrollTop: $(".productdesc").offset().top
            },
                'slow');
        });




