                        Canon Angle Finder C with adapters EC-C & ED-C

         Canon Angle Finder C with adapters EC-C & ED-C
The Canon Angle Finder C clips to the EOS camera eyepiece to make it easier to view the image with low-angle picture taking, or when the camera is on a copy stand. The image is both the right way up, and the right way round. Magnification can be switched from 1.25x to 2.5x for precise focusing. The Canon Angle Finder C is supplied with adapters for all EOS eyepiece mounts.    








